●ストームケースは高い気密性・防水性と耐衝撃性、耐圧性、防塵性を兼ね備えた、軽量ボディのタフツールケースです。●過酷な環境を耐えうる、タフなケースとして多くのプロフェッショナルに信頼されています。●産業界においても、精密機器の搬送・運搬用に広く用いられています。●大型のプロテクターツールケースです。<BR>●各種精密機器などの安全な運搬、保管に。●パソコンや大型の計測機器などの保管に。<BR>●色:黒●タイプ:ウレタンフォームなし●外寸(mm)間口×奥行×高さ:795×518×310●有効内寸(mm)間口×奥行×高さ:736×457×267●蓋の深さ:51●底の深さ:216●使用温度:－29～60度●質量(kg):9.43<BR>●外寸(mm)間口×奥行×高さ：795×518×310●有効内寸(mm)間口×奥行×高さ：736×457×267●キャスター付●伸縮ハンドル付●南京錠径：7.8mm(南京錠別売)●ブロックウレタンフォーム(1.5cm毎の切れ込み／任意の形状に切り取り加工可能)●プッシュタイプラッチ●Ｏリング(ネオブレン)●自動気圧調整バルブ●ラバータイプのソフトグリップ●南京錠を通す穴付き<BR>●本体:HPX(高強度ポリプロピレン系樹脂)<BR>●ＮＦ型番にはブロックウレタンフォームは付属しません。<tr><td colspan="2">
